import React,{Component} from 'react';
import {useState} from 'react';

export class Home extends Component {
    
    render(){

      const [tag,setAge]=useState("")

        const search = () => {
          console.log(tag)
        }

        return(
            <div className="container mt-3">
            <div className="row">
              <div className="col">
              </div>
              <div className="col-8">
                  <div className="input-group mb-3">
                  <input type="text" value={tag} className="form-control" placeholder="Tag" aria-label="Search Tag" aria-describedby="button-addon2"/>
                  <button className="btn btn-outline-secondary" onClick={search} type="button" id="button-addon2">Search</button>
                  </div>
              </div>
              <div className="col">
              </div>
            </div>
          </div>
        )
    }
}
